struct adi_adrv9001_Init *adrv9002_init_get(void)
{
	uint32_t *axi_config = (uint32_t *)(RX1_ADC_BASEADDR + 0xC);
	if (*axi_config & (1<<7))
		return &adrv9002_init_cmos;
	else
		return &adrv9002_init_lvds;
}

